import { motion } from "framer-motion";
import React,{useState} from "react"
import styles from "./Projects.module.css"
import Imagenes from "../../images/cielo.png";
import {Carousel} from 'react-bootstrap';
import toDo from "../../images/toDo.png";
import{ FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import{faLaptop} from "@fortawesome/free-solid-svg-icons"
function Projects (){ 


const [index, setIndex] = useState(0);

const handleSelect = (selectedIndex, e) => {
  setIndex(selectedIndex);
};

    return (
      <motion.div

      
      className={styles.container}>
        <div className={styles.containerTitle}>
          <h2 className={styles.title}> My Projects </h2>
        </div>

        <div className={styles.containerCarousel}>
      <Carousel className={styles.carousel} activeIndex={index} onSelect={handleSelect}>
        <Carousel.Item className={styles.images}>
          <img
            className="d-block w-100"
            src={Imagenes}
            alt="First slide"
          />
          <Carousel.Caption>
            <button >Weather App</button>
          </Carousel.Caption>
        </Carousel.Item>

        <Carousel.Item className={styles.images2}>
        <img
            className="d-block w-100"
            src={toDo}
            alt="First slide"
          />
          <Carousel.Caption >
            <button>To Do App</button>
          </Carousel.Caption>
        </Carousel.Item>

        <Carousel.Item className={styles.images3}>
          <div className={styles.neon}>
            <span className={styles.text} data-text="Lauflix">Lauflix</span>
            <span className={styles.gradient}></span>
            <span className={styles.spotlight}></span>
          </div>
          <Carousel.Caption>
            <button>Movies App</button>
          </Carousel.Caption>
        </Carousel.Item>

    </Carousel>
    </div>
    </motion.div>
    
    );
}
export default Projects;
